import React from 'react';
import useDatafetch from '../useDatafetch';
function CountryContainer(){
    const {flagName} = useDatafetch();
    console.log(flagName.data)
    const flags = flagName.data
    return(
        <div>
            {flags.map(flag =>{
                return <p>{flag[0]}</p>
            })}
            india
        </div>
    )
}
export default CountryContainer;
